import ExpenseItem from "./ExpenseItem";

function Expenses({ expenses }) {
  return (
    <div>
      {expenses.map((expense) => {
        const { id, date, title, amount } = expense;
        return (
          <ExpenseItem key={id} date={date} title={title} amount={amount} />
        );
      })}
    </div>
  );
}

export default Expenses;
